import React from 'react'
import "HomePage.css"


export default function HomePage() {
    return (
        <div>
        <h1> Homepage will add widgets later</h1>
        <form className="form">
          <TextField
            labelText="Email"
            id="email"
            formControlProps={{
              fullWidth: true
            }}

            type="text"
          />
          <I
            labelText="Password"
            id="password"
            formControlProps={{
              fullWidth: true
            }}
            handleChange={this.handleChange}
            type="password"
          />

          <Button type="button" color="primary" className="form__custom-button">
            Log in
          </Button>
        </form>

        </div>
    )
}
